import React, { useEffect, useState } from 'react';
import { NavLink } from 'react-router-dom';
import classes from './Catalog.module.css';

export default function Catalog() {
    const titles = ['первая', 'вторая', 'третья'];
    return (
        <main className={classes.catalog__container}>
            <h3>Каталог</h3>
            <div className={classes.contacts__container}>
                {titles.map((el, id)=> {
                    return <NavLink key={id} to={`/${id}>`}><span className={classes.contacts__cards}>{el}</span></NavLink>
                })}
            </div>
        </main>
  );
}
